import * as o from "react";
import e from "../lib/IconBase.es.js";
import r from "../defs/Stamp.es.js";
const t = o.forwardRef((a, m) => /* @__PURE__ */ o.createElement(e, { ref: m, ...a, weights: r }));
t.displayName = "StampIcon";
const s = t;
export {
  s as Stamp,
  t as StampIcon
};
